import './Photos.css';
import React from 'react';
import {Link} from "react-router-dom";

function Photos() {
    return (
        <div className="Photos-background">
            <header className="App-header">
            <div className='LandingTitle'>
                <h1 className="Title">
                bruhaps
                </h1>
                <Link to="/">
                    <button className="App-links">
                        mainpage
                    </button>
                </Link>

          </div>

        </header>
      </div>
    );
}

export default Photos;
